import NavBar from "./NavBar";
import { Routes, Route } from "react-router-dom";

function App() {
    return (
        <div className="App">
            <Routes>
                <Route path="/"></Route>
            </Routes>
            <NavBar />
        </div>
    );
}

export default App;
